// material-ui

import {
    Drawer,
    Fab,
    FormControl,
    FormControlLabel,
    Grid,
    IconButton,
    Radio,
    RadioGroup,
    Slider,
    Tooltip,
    Typography
} from '@mui/material';
// project imports
import MainCard from 'ui-component/cards/MainCard';

// ==============================|| SAMPLE PAGE ||============================== //

const Profile = () => (
    <Grid container spacing={2}>
        <Grid item xs={12}>
            <MainCard>
                <Typography
                    style={{
                        textAlign: 'center',
                        fontSize: '2.5rem',
                        fontWeight: 'bold',
                        marginBottom: '1.5rem'
                    }}
                    variant="h1"
                >
                    Profile
                </Typography>
            </MainCard>
        </Grid>
    </Grid>
);

export default Profile;
